from collections import defaultdict
def lengthOfLongestSubstring(s):
    if len(s) == 1:
        return 1

    letterDict = defaultdict(int)
    i = 0
    tmpSize = 0
    result = 0
    sub = ""

    while i < len(s):
        if s[i] not in sub:
            sub += s[i]
            letterDict[s[i]] = i
        elif s[i] in sub:
            lastIndex = letterDict[s[i]]
            sub = s[lastIndex + 1:i]
            sub += s[i]
            result = max(result,len(sub))
            letterDict[s[i]] = i

        # print sub
        result = max(result,len(sub))
        i += 1

    return result

